CREATE TABLE videos (
  id SERIAL PRIMARY KEY NOT NULL,
  title VARCHAR(255) NOT NULL,
  description VARCHAR(1000) NOT NULL,
  filePath VARCHAR(255) NOT NULL,
  isMovie INTEGER DEFAULT 0,
  uploadDate TIMESTAMP WITH TIME ZONE DEFAULT CURRENT_TIMESTAMP,
  releaseDate DATE NOT NULL DEFAULT CURRENT_DATE,
  views INTEGER DEFAULT 0,
  duration VARCHAR(10) NOT NULL,
  season INTEGER DEFAULT 0,
  episode INTEGER DEFAULT 0,
  entity_id INTEGER NOT NULL REFERENCES entities(ent_id) ON DELETE CASCADE
);

SET timezone = 'Asia/Calcutta';

